import React from 'react';
import Work from './workTime';
import NonWork from './NonWorkTime';
const Home = ()=>{
    return(
        <>
        <h1>Restrictions</h1>
        <div className='row'>
            <div className='col-10 m-auto'>
            <div className='col-12 mt-4'>
                <button className='btn btn-primary float-left ml-5'>Work Time</button>
                <button className='btn btn-light float-left'>Non-Work Time</button>
            </div>
            
            <div className='col-12 '>
                    <Work/>
            </div>
            </div>
        </div>
       
        </>
    )
}

export default Home
